	import {
		HengShare,
		InviteShare,
		JianshuShare,
		JianshuLeftShare,
		WxCodeModal,
		JuejinShare,
		InfoShare,
		SinaShare,
		YanShare
	} from "./components";
    import * as mutils from '@/utils/mUtils'

	export default {
	  data(){
			return {
				wxModal:{
					show:false,
					width:"358px",
					height:"358px",
				}
			}
		},
		components:{
			HengShare,
			InviteShare,
			JianshuShare,
			JianshuLeftShare,
			WxCodeModal,
			JuejinShare,
			InfoShare,
			SinaShare,
			YanShare
		},
		mounted(){
			mutils.setContentHeight(this,this.$refs.shareContainer,210);
		},
		methods: {
			hideWxCodeModal(){
				this.wxModal.show = false;
			},
			// 分享到微信，显示微信二维码弹框；
			shareToWeixin(){
				this.wxModal.show = true;
			},
			shareToQQ(){
				this.shareConfig('qq')
			},
			shareToQQzone(){
				this.shareConfig('qqZone')
			},
			shareToWeibo(){
				this.shareConfig('weibo')
			},
			shareToDouban(){
				this.shareConfig('douban')
			}
		}
	}
